const sourceCode = "import Image from 'next/image';\nimport { Bleed } from 'nextra/components';\n\n# Figma Plugin\n\nThe Boxicons Figma plugin lets you search, preview, and insert Boxicons directly into your Figma designs. Itâ€™s the fastest way to use Boxicons while designing, without leaving Figma.\n\nYou can browse the full icon library, switch between styles and weights, and insert icons as editable SVGs with a single click.\n<br/>\n---\n\n## Install the Plugin\n\nYou can install the Boxicons plugin directly from the Figma Community:\n\nðŸ‘‰ **Open the Boxicons Figma Plugin page**  \nhttps://www.figma.com/community/plugin/1591165962558819240\n\nClick **Run** and the plugin will be added to your Figma account.\n\n## Open the Plugin\n\n1. Open any Figma file.\n2. Right-click on the canvas.\n3. Select **Plugins â†’ Boxicons**.\n\nThe Boxicons panel will open inside Figma.\n\n<Bleed className=\"rounded-4xl overflow-hidden border border-black/10 dark:border-white/10\" full>\n <Image src=\"/install.gif\" alt=\"Figma Plugin Install\" width={3816} height={1706} />\n</Bleed>\n\n## Using the Plugin\n<div className=\"flex gap-5 space-between flex-col md:flex-row\">\n<div className=\"basis-1/2 py-5\" >\n\n1. Use the search bar to find any icon by name or keyword.\n2. Filter by pack, style, or weight if needed.\n3. Click an icon to insert it into your canvas.\n\nIcons are inserted as **editable SVGs**, so you can:\n- Change colors\n- Resize freely\n- Edit paths\n- Apply effects and styles\n\n</div>\n<div className=\"basis-1/2 py-5   rounded-2xl overflow-hidden \" >\n<Image className=\"rounded-2xl  figma-side\" src=\"/filter.gif\" alt=\"Figma Plugin Filter\" width={1024} height={1180} />\n</div>\n</div>\n\n\n\n\n\n## Need Help?\n\nIf you run into any issues or have feedback, contact us at:\n\n**contact@boxicons.com**\n\nWe aim to reply within 24 hours.";
