const sourceCode = "# Introduction\n\nWelcome to the official Boxicons documentation. This guide will help you understand what Boxicons is, whatâ€™s included in each plan, and how to get the most out of the icon library in your design and development workflows.\n\n## What is Boxicons?\n\nBoxicons is a high-quality, modern icon library built to elevate your UI and product design.\n\nBoxicons currently offers **5 icon packs**:\n\n- Basic\n- Filled\n- Duotone\n- Duotone Solid\n- Duotone Mix\n\nEach pack includes:\n\n- **3 styles:** Regular, Rounded, Sharp\n- **3 weights:** Normal, Thin, Bold\n\nThis results in **50,000+ icon variations** across all packs, giving you complete flexibility to match any design system or product aesthetic.\n\nAll icons are optimized for clarity, consistency, and performance across web and app interfaces.\n\n## What do I get with Boxicons Pro?\n\n> The free version is great for testing and lightweight usage. Boxicons Pro unlocks the full library and all tools.\n\n### Free version includes\n\n- Basic â€” Regular â€” Normal\n- Filled â€” Regular â€” Normal\n\n### Boxicons Pro includes\n\nAll remaining variations:\n\n- All weights (Normal, Thin, Bold)\n- All styles (Regular, Rounded, Sharp)\n- All Duotone packs and variants\n\nPlus premium tools and features:\n\n- Access to **year-long updates** (new icons & new duotone releases)\n- **Figma plugin** for seamless designer workflows\n- **React package** for easy developer integration\n- **Icon Explorer** to browse, customize, and export icons in common formats in seconds\n- **Teams and Enterprise plans** with user management:\n  - Teams: up to 8 users\n  - Enterprise: up to 40 users\n\n## Whatâ€™s Coming Next?\n\n> Boxicons is actively evolving.\n\nWe are continuously working on:\n\n- New icon packs\n- New duotone variations\n- New platform integrations\n- Workflow and performance improvements\n\nYou can stay updated on upcoming features and releases on : \n\n**Changelog** page [here](https://boxicons.com/changelog) and **Roadmap** page [here](https://boxicons.com/roadmap).\n\nMore tools and packages are already planned and will be released over time.\n\n## Need Support?\n\n> If you need help, weâ€™re here for you.\n\nContact us at:\n\n**[contact@boxicons.com](mailto:contact@boxicons.com)**\n\nWe aim to respond to all support requests within **24 hours**.";
